import React from 'react';
import './App.css';
import tag from './assets/img/tag.svg';
import github from './assets/img/github.svg';
import linkedin from './assets/img/linkedin.svg';
import twitter from './assets/img/twitter.png';

function App() {
  return (
    <div className="App">
      <img src={tag} alt='tag' /> 
      <h1>Rafael <strong>dev</strong></h1>
      <p>
        <span> HTML</span> - 
        <span> CSS</span> - 
        <span> JS</span> - 
        <span> React</span> - 
        <span> React Native</span> - 
        <span> Redux</span> - 
        <span> NodeJs</span>
      </p>
      <p>
        <a href="https://github.com/rafaelangical" target='blank'><img src={linkedin} alt ='linkedin'/></a>
        <a href="https://twitter.com/rafaelangical" target="blank"><img src={twitter} alt ='twitter'/></a>
        <a href=""><img src={github} alt ='github'/></a>
      </p>
    </div>
  );
}

export default App;
